$CHARS_MAX_CHAR_COUNT = max(array_map(function($arr) {
    return count($arr);
}, $CHAR_MAP));

function decode_leet_chars(string $password): string {
    global $CHARS_MAX_CHAR_COUNT, $CHAR_MAP;
    for ($i=0; $i < $CHARS_MAX_CHAR_COUNT; $i++) {
        foreach ($CHAR_MAP as $key => $array_of_chars) {
            if ($i < count($array_of_chars)) {
                $password = str_replace($array_of_chars[$i], $key, $password);
            }
        }
    }
    return $password;
}

/**
 * Get ascii only string 
 * @param string $str String to be parsed
 * @return string ASCII only string
 */
function get_ascii_only_string(string $str): string {
    $result = '';
    for ($i=0; $i < mb_strlen($str); $i++) {
        $char = mb_substr($str, $i, 1);
        if (mb_ord('a') <= mb_ord($char) && mb_ord($char) <= mb_ord('z')) {
            $result .= $char;
        }
    }
    return $result;
}


function word_use_analysis(string $password) {
    global $CHARS_MAX_CHAR_COUNT, $WORD_USE_FREQUENCY, $WORD_USE_FREQUENCY_SUM;

    $leet_password = get_ascii_only_string(decode_leet_chars($password));
    $_password = get_ascii_only_string($password);

    $leet_password = mb_strtolower($leet_password);
    $_password = mb_strtolower($_password);

    $leet_password_words = [];
    $_password_words = [];

    foreach ($WORD_USE_FREQUENCY as $key => $res) {
        // We found word in leet password
        if (mb_strpos($leet_password, $key) !== false) {
            array_push($leet_password_words, array($key, $res[0], $res[1]));
        }

        // We found word in password
        if (mb_strpos($_password, $key) !== false) {
            array_push($_password_words, array($key, $res[0], $res[1]));
        }
    }

    // Get paswords with higher length
    $words = count($leet_password_words) > count($_password_words) ? $leet_password_words : $_password_words;

    $result = array(
        'words' => array(),
        'result' => 0.0
    );

    if (count($words) == 0) {
        return $result;
    }

    foreach ($words as $value) {
        // Get word and their number of occurrences
        array_push($result['words'], array($value[0] => $value[1]));
        $result['result'] += $value[2] / $WORD_USE_FREQUENCY_SUM;
    }

    $result['result'] /= count($words);

    return $result;
}

